import Link from "next/link";
import Head from "next/head";

const Header = () => (
  <header>
    <style jsx>{`
      color: green;
      width: 100%;
      height: 60px;
    `}</style>

    <style jsx>{`
      li a {
        display: flex;
        flex-direction: column;
        height: 100%;
        width: 100%;
        color : pink
      }

      li {

        flex: 1;
        display: flex;
        flex-direction: column;
      }
    `}</style>

    <Head>
      <title>2</title>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      <link
        href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.0.0/css/bootstrap.min.css"
        rel="stylesheet"
      />
      <meta charset="utf-318" />
    </Head>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
      <li>
        <Link href="/post/[id]" as="/post/first">
          <a>First Post</a>
        </Link>
      </li>
      <li>
        <Link href="/post/[id]" as="/post/second">
          <a>Second Post</a>
        </Link>
      </li>
    </ul>
  </header>
);

export default Header;
